import React from "react";
import Aside from "./Aside";
import Section from "./Section";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Home from "../ComponentLink/Home";


const Main = () => {
    return (
        <div className="main-div">
            <Router>
                <Aside />
                <Section />

                <Switch>
                    <Route path="/home">
                        <Home />
                    </Route>
                </Switch>
            </Router>

        </div>
    )
}

export default Main
